/*

This program was written by @jacob-zietek when I was in high school.
In the VEX Robotics competition, there is an autonomous portion
before a driver controlled period where each robot must perform tasks
fully autonomously. This program was made to generate autonomous 
routes on the fly quickly. The program records the exact controller
and motor movements that are made while a driver controls a robot,
records it, and stores it into an SD card. You can then recover the
route by taking it from the SD card and running the 750x8 array of 
values one by one. This records 8 motor movements at a 20ms refresh
rate. Once played back, it's as if the driver is controlling the robot.

This program was mostly used at the VEX Robotics VRC Turning Point 
competition for team 1353P, but since then others have reused this code.

*/


