std::ofstream ofs;

// Formatiing function
std::string toString(int val)
{
    std::stringstream stream;
    stream << val;
    return stream.str();
}

// Formatting function
std::string formatToString(int num){
  if(num == 100){
    return "100,";
  } else if((num >= 10) && (num < 100)){
    return (toString(num) + ",");
  } else {
    return (toString(num) + ",");
  }
}

// This takes each row of the recorded driver period and sets
// each motor accordingly to replay the movements.
void runMappedAuto(int start, int finish, int auton[750][8]){
  int i = start;
  while(i < finish){
    if(auton[i][0] != 0){
      backLeft.spin(vex::directionType::fwd, auton[i][0], vex::velocityUnits::pct);
    } else {
      backLeft.stop();
    }
    if(auton[i][1] != 0){
      backRight.spin(vex::directionType::fwd, auton[i][1], vex::velocityUnits::pct);
    } else {
      backRight.stop();
    }
    if(auton[i][2] != 0){
      frontLeft.spin(vex::directionType::fwd, auton[i][2], vex::velocityUnits::pct);
    } else {
      frontLeft.stop();
    }
    if(auton[i][3] != 0){
      frontRight.spin(vex::directionType::fwd, auton[i][3], vex::velocityUnits::pct);
    } else {
      frontRight.stop();
    }
    if(auton[i][4] != 0){
      flywheel1.spin(vex::directionType::fwd, auton[i][4], vex::velocityUnits::pct);
    } else {
      flywheel1.stop();
    }
    if(auton[i][5] != 0){
      intake1.spin(vex::directionType::fwd, auton[i][5], vex::velocityUnits::pct);
    } else {
      intake1.stop();
    }
    if(auton[i][6] != 0){
      intake2.spin(vex::directionType::fwd, auton[i][6], vex::velocityUnits::pct);
    } else {
      intake2.stop();
    }
    if(auton[i][7] != 0){
      flywheel2.spin(vex::directionType::fwd, auton[i][7], vex::velocityUnits::pct);
    } else {
      flywheel2.stop();
    }
    vex::task::sleep(20);
    i++;
  }
}


void pre_auton( void ) {
  backLeft.stop(vex::brakeType::brake);
  frontLeft.stop(vex::brakeType::brake);
  frontRight.stop(vex::brakeType::brake);
  backRight.stop(vex::brakeType::brake);
  intake2.stop(vex::brakeType::brake);
  intake1.stop(vex::brakeType::hold);
  flywheel1.stop(vex::brakeType::coast);
  flywheel2.stop(vex::brakeType::coast);
}


void autonomous( void ) {
  backLeft.stop(vex::brakeType::brake);
  frontLeft.stop(vex::brakeType::brake);
  frontRight.stop(vex::brakeType::brake);
  backRight.stop(vex::brakeType::brake);
  intake2.stop(vex::brakeType::brake);
  intake1.stop(vex::brakeType::hold);
  flywheel1.stop(vex::brakeType::coast);
  flywheel2.stop(vex::brakeType::coast);
  runMappedAuto(0, 750, bb);
}


void usercontrol( void ) {
  backLeft.stop(vex::brakeType::brake);
  frontLeft.stop(vex::brakeType::brake);
  frontRight.stop(vex::brakeType::brake);
  backRight.stop(vex::brakeType::brake);
  intake2.stop(vex::brakeType::brake);
  intake1.stop(vex::brakeType::hold);
  flywheel1.stop(vex::brakeType::coast);
  flywheel2.stop(vex::brakeType::coast);
  
  // Starting to record driver movement
  while (true) {
    // Recording is initialized by pressing the A button
    if(Controller1.ButtonA.pressing()){
      // Open a text file on the SD card called auto1.txt
      ofs.open("auto1.txt", std::ofstream::out);
      int i = 0;
      // For 750 20ms intervals, record the value each motor is being set
      // and format it such that the output is a 2d array of 750x8
      while(true && i < 750){
        if(Brain.SDcard.isInserted()){
          if(abs(Controller1.Axis3.value()) > 17 || abs(Controller1.Axis4.value()) > 17){
            backLeft.spin(vex::directionType::fwd, (Controller1.Axis3.position(percentUnits::pct) + Controller1.Axis4.position(percentUnits::pct)), vex::velocityUnits::pct);
            frontLeft.spin(vex::directionType::fwd, (Controller1.Axis3.position(percentUnits::pct) + Controller1.Axis4.position(percentUnits::pct)), vex::velocityUnits::pct);
            backRight.spin(vex::directionType::fwd, (Controller1.Axis3.position(percentUnits::pct)  - Controller1.Axis4.position(percentUnits::pct)), vex::velocityUnits::pct);
            frontRight.spin(vex::directionType::fwd, (Controller1.Axis3.position(percentUnits::pct) - Controller1.Axis4.position(percentUnits::pct)), vex::velocityUnits::pct);
        } else{
            frontLeft.stop();
            frontRight.stop();
            backLeft.stop();
            backRight.stop();
        }

        if(Controller1.ButtonA.pressing()){
          flywheel1.spin(vex::directionType::fwd, 350, vex::velocityUnits::rpm);
          flywheel2.spin(vex::directionType::fwd, 350, vex::velocityUnits::rpm);
        } else if (Controller1.ButtonR1.pressing()){
          flywheel1.spin(vex::directionType::fwd, 100, vex::velocityUnits::pct);
          flywheel2.spin(vex::directionType::fwd, 100, vex::velocityUnits::pct);
        } else if (Controller1.ButtonY.pressing()){
          flywheel1.spin(vex::directionType::rev, 100, vex::velocityUnits::pct);
          flywheel2.spin(vex::directionType::rev, 100, vex::velocityUnits::pct);
        } else {
          flywheel1.stop(vex::brakeType::coast);
          flywheel2.stop(vex::brakeType::coast);
        }

        if(Controller1.ButtonL1.pressing()){
          intake1.spin(vex::directionType::fwd, 100, vex::velocityUnits::pct);
        } else if (Controller1.ButtonY.pressing()){
          intake1.spin(vex::directionType::rev, 100, vex::velocityUnits::pct);
        } else {
          intake1.stop();
        }

        if(Controller1.ButtonL2.pressing()){
          intake2.spin(vex::directionType::fwd, 100, vex::velocityUnits::pct);
        } else if (Controller1.ButtonR2.pressing()){
          intake2.spin(vex::directionType::rev, 100, vex::velocityUnits::pct);
        } else {
          intake2.stop();
        }
          ofs << "{";
          if(abs(Controller1.Axis3.value()) > 17 || abs(Controller1.Axis4.value()) > 17){ // drive
            ofs << formatToString(Controller1.Axis3.position(percentUnits::pct) + Controller1.Axis4.position(percentUnits::pct));
            ofs << formatToString(Controller1.Axis3.position(percentUnits::pct) - Controller1.Axis4.position(percentUnits::pct));
            ofs << formatToString(Controller1.Axis3.position(percentUnits::pct) + Controller1.Axis4.position(percentUnits::pct));
            ofs << formatToString(Controller1.Axis3.position(percentUnits::pct) - Controller1.Axis4.position(percentUnits::pct));
        } else {
            ofs << formatToString(0); 
            ofs << formatToString(0);
            ofs << formatToString(0);
            ofs << formatToString(0);
        }

        if(Controller1.ButtonR1.pressing()){ // flywheel 1
          ofs << formatToString(100);
        } else {
          ofs << formatToString(0);
        }

        if(Controller1.ButtonL1.pressing()){ // intake1
          ofs << formatToString(100);
        } else if (Controller1.ButtonY.pressing()){
          ofs << formatToString(-100);
        } else {
          ofs << formatToString(0);
        }

        if(Controller1.ButtonL2.pressing()){ //intake2
          ofs << formatToString(100);
        } else if (Controller1.ButtonR2.pressing()){
          ofs << formatToString(-100);
        } else {
          ofs << formatToString(0);
        }

        if(Controller1.ButtonR1.pressing()){ // flywheel 2
          ofs << toString(100);
        } else {
          ofs << toString(0);
        }
          ofs << "},";
      } else {
        Brain.Screen.print('N'); 
      }

      vex::task::sleep(20);
      i++;
      }
    ofs.close();
    }
  }
}



int main() {
    Competition.autonomous( autonomous );
    Competition.drivercontrol( usercontrol );

    pre_auton();
              
    while(1) {
      vex::task::sleep(100);
    }    
       
}
